const input = '';

const testInput = 'dabAcCaCBAcCcaDA';
const test = 'eEe';

function getChain(input) {
  // match duplicate characters
  var pattern = /(.)\1/;
  // ..ignore case and grab all duplicate pairs
  var regex = new RegExp(pattern, 'ig');
  var matches = input.match(regex);

  if (matches) {
    // throw out pairs that have the same casing
    matches = matches.filter((val)=>{
      if (val[0] !== val[1]){
        return val;
      }
    });

    if (matches.length === 0) {
      return null;
    } else {
      // we only need the first one
      return matches[0];
    }
  } else {
    return null;
  }
}

function reaction(input, chain) {
  return input.replace(chain,'');
}

function startReaction() {
  let final = testInput,
  _chain = '',
  stop = false;

  while (stop === false) {
    _chain = getChain(final);
    if(!_chain){
      console.log('no more chains');
      stop = true;
    } else {
      final = reaction(final, _chain);
    }

  }
}

startReaction();
